package GUIBasic13;import javax.swing.*;import java.awt.*;/** * Layout Manager: Define the natural layout for components within a container * GridLayout: Places components in a grid of cell. * Each component takes all the available space within its cell, * and each cell is the same size */public class MyGridLayOut extends JFrame {    public static void main(String[] args) {        MyGridLayOut frame = new MyGridLayOut();        frame.setTitle("Grid Layout Example");        frame.setSize(420, 420);        frame.setLocation(720, 100);        frame.setDefaultCloseOperation(JFrame.EXIT_ON_CLOSE);        frame.setLayout(new GridLayout(3,3, 10,10));        for(int i = 1; i < 10; i ++){            frame.add(new JButton(""+i));        }        frame.setVisible(true);    }}